import ApiService from '../../../services/api.service'

const state = {
    // consultas 
    consultas: {
        apiresponse: null,
        selected: null,
        filtro: '',
        loading: false,
        loadingparams: false,
        data: [{}]
    }
}

const getters = {

    gtxconsultasresponse: state => state.consultas.apiresponse,
    gtxconsultasSuccess: (state, getters) => (getters.gtxconsultasresponse) ? getters.gtxconsultasresponse.Success == 'True' : false,
    gtxconsultasError: (state, getters) => (getters.gtxconsultasSuccess) ? { Success: false, Error: getters.gtxconsultasresponse.Error } : [],
    gtxconsultasData: (state, getters) => (getters.gtxconsultasSuccess) ? getters.gtxconsultasresponse.Data : [],
    gtxconsultasselected: (state, getters) => (state.consultas.selected) ? state.consultas.selected : null,
    gtxconsultasselectedparams: (state, getters) => (getters.gtxconsultasselected && getters.gtxconsultasselected.config && getters.gtxconsultasselected.config.param) ? getters.gtxconsultasselected.config.param : []

}

const mutations = {

    setConsultas: (state, data) => state.consultas.apiresponse = data,
    setConsultaSelected: (state, data) => state.consultas.selected = data,
    setConsultasLoading: (state, load) => state.consultas.loading = load

}

const actions = {

    actConsultas: state => {
        // se passar de um dia chama novo token ...
        // console.log('state.state.loginAnon.lastLogin: ', state.state.loginAnon.lastLogin)
        // console.log('moment(state.state.loginAnon.lastLogin).add(1, days): ', moment(state.state.loginAnon.lastLogin).add(1, 'days'))
        // se não tem token ou a data do token mais um dia ainda é menor que agora, atualiza ...
        // if (!state.state.loginAuth.lastLogin || moment(state.state.loginAuth.lastLogin).add(1, 'days') < Date()) {
        ApiService.setAuthHeader()

        // state.commit('setLoading', { show: true, message: 'Consultando...' })
        ApiService.get('Servicos/Consultas/Select')
            .then(res => {
                state.commit('setLoading', { show: false })
                console.log(res.data)
                state.commit('setConsultas', res.data)
            })
            .catch(error => {
                // console.error(error.message)
                state.commit('setLoading', { show: false })
                    // sstate.commit('setSystemErrorLog', error)
                throw new Error(`[VUEX] ${error}`)
            })
            // } else {
            //  console.log('Usuário não autenticado: ', state.state.loginAuth)
            // }
    },

    actConsultasSelectGetData: (state, params) => {
        
        params.config.param.map(par => {
            if (par.api) {
                // se o parametro não tem o campo data vazio ele precisa esperar o retorno da api para criar e renderizar na tela
                // então é usado esse contador para só abrir a aba dos parametros depois de ter o campo data para poder carregar na tela
                if (!par.data || par.data.length==0) {
                    params.done++
                    ApiService.setAuthHeader()
        
                    ApiService.get(par.api)
                        .then(res => {
                            par.data = res.data.Data
                            params.done--
                        })
                        .catch (error => {
                            console.error(error.message)
                            throw new Error(`[storeConsultas] ${error}`)
                        })
                }
            }
        })

    },

    actConsultasSelected: (state, id) => {

        const params = state.getters.gtxconsultasData.find(f => f.id == id)

        if ((params) &&
            (params.hasOwnProperty('config')) &&
            (params.config.hasOwnProperty('param'))) {
            state.dispatch('actConsultasSelectGetData', params)
                .then(() => {
                    console.log('actConsultasSelected:', params)
                    state.commit('setConsultaSelected', params)
            })
        } else {
            console.log('actConsultasSelected:Não tem parametros')
            state.commit('setConsultaSelected', params)
        }

    }
}

export default { state, mutations, getters, actions }
